import styled from "styled-components";
import React, { memo } from "react";
import { Handle, Position } from "reactflow";

const Node = styled.div`
  padding: 10px 20px;
  border-radius: 5px;
  font-size: 20px;
  background-color: ${(props) => props.theme.consequenceNodeBG};
  color: #fff;
  border: 2px solid ${(props) => (props.selected ? "#ff0072" : "#41436a")};
`;

export default memo((props) => {
  return (
    <Node selected={props.selected}>
      <div>
        <Handle type="target" position={Position.Left} />
        {props.data.label}
      </div>
      <Handle type="source" position={Position.Right} />
    </Node>
  );
});

export const NodeWFunction = memo((props) => {
  console.log(props);
  return (
    <Node selected={props.selected}>
    {
      (props.type==='highLevelNode')
      ? null: <Handle type="target" position={Position.Left} />
    }
      <div>
        {props.data.label}
      </div>
      <Handle type="source" position={Position.Right} />
      {
      (props.type==='consequenceNode')
      ? null: <Handle type="source" position={Position.Right} />
    }
    </Node>
  );
});
